<img id="daleImg" class="fixed z-10 dvd-screen-animation" src="data:image/png;base64," alt="">

<script type="text/javascript">
    let img = document.getElementById("daleImg");
    let style = window.getComputedStyle(img);
    (function() {
    

    let w = window.outerWidth;
    let h = window.outerHeight;

    let wMin = w * 0.05;
    let wMax = w * 0.92;

    console.log(w);

    console.log("Min " + wMin);
    console.log("Max " + wMax);
    
    setInterval(function () {
        let curPos = parseInt(style.marginLeft);

        if(curPos >= wMax)
        {
            flipLeft();
        }

        if(curPos <= wMin)
        {
            flipRight();
        }

    }, 100);

    })();
    
    function flipLeft()
    {
        img.style.transform = "scaleX(1)";
    }

    function flipRight()
    {
        img.style.transform = "scaleX(-1)";
    }

</script>